from selenium import webdriver
from selenium.webdriver.common.by import By
from selenium.webdriver.common.keys import Keys
from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC
from selenium.common.exceptions import TimeoutException
import time

def login_to_instagram(username, password):
    # Initialize Chrome WebDriver
    driver = webdriver.Chrome()

    try:
        # Open Instagram login page
        driver.get("https://www.instagram.com/accounts/login/")
        
        # Wait for the login elements to become available
        username_field = WebDriverWait(driver, 10).until(
            EC.presence_of_element_located((By.NAME, "username"))
        )
        password_field = WebDriverWait(driver, 10).until(
            EC.presence_of_element_located((By.NAME, "password"))
        )
        
        # Enter username and password
        username_field.send_keys(username)
        password_field.send_keys(password)
        
        # Submit the login form
        password_field.send_keys(Keys.RETURN)
        
        # Wait for the login process to complete
        time.sleep(5)  # Adjust delay based on internet speed
        
        # Check if login was successful
        if "accounts/login" in driver.current_url:
            print("Login failed. Please check your username and password.")
            return None
        else:
            print("Login successful!")

            # Check if the "Turn On Notifications" prompt appears
            not_now_button = WebDriverWait(driver, 10).until(
                EC.presence_of_element_located((By.XPATH, "//button[text()='Not Now']"))
            )
            # Click on the "Not Now" button to dismiss the prompt
            not_now_button.click()
        return driver
    
    except Exception as e:
        print("An error occurred:", e)
        return None

def send_messages(driver, usernames, passwords, start_index):
    try:
        for i in range(start_index, len(usernames)):
            username_to_search = usernames[i]
            send_message(driver, username_to_search)
            time.sleep(6)  # Add a 6-second delay between sending messages
            if (i + 1) % 50 == 0:  # Log out and log in every 10 messages
                driver.get("https://www.instagram.com/accounts/logout/")
                time.sleep(5)  # Wait for logout to complete
                driver.quit()  # Close the current WebDriver session
                new_index = i + 1 if i + 1 < len(usernames) else 0
                new_username = usernames[new_index]
                new_password = passwords[new_index]
                driver = login_to_instagram(new_username, new_password)
                if driver is None:
                    return
                # Continue sending messages from where the last account left off
                send_messages(driver, usernames, passwords, new_index)
                return
    
    except Exception as e:
        print("An error occurred:", e)

def send_message(driver, username):
    try:
        message_icon = WebDriverWait(driver, 10).until(
            EC.presence_of_element_located((By.XPATH, f"//a[@href='/direct/inbox/']"))
            )
        message_icon.click()

        # Click on the "New message" button
        new_message = WebDriverWait(driver, 10).until(
            EC.element_to_be_clickable((By.CSS_SELECTOR, "svg[aria-label='New message']"))
        )
        new_message.click()

        # Search for the username
        search_box = WebDriverWait(driver, 10).until(
             EC.presence_of_element_located((By.NAME, "queryBox"))
        )
        search_box.clear()
        search_box.send_keys(username)

        # Select the user
        checkbox = WebDriverWait(driver, 10).until(
            EC.presence_of_element_located((By.NAME, "ContactSearchResultCheckbox"))
        )
        checkbox.click()

        # Click on the "Chat" button
        chat_button = WebDriverWait(driver, 10).until(
            EC.element_to_be_clickable((By.XPATH, "//div[contains(@class, 'x1i10hfl') and text()='Chat']"))
        )
        chat_button.click()

        # Enter message
        text_box = WebDriverWait(driver, 10).until(
            EC.presence_of_element_located((By.XPATH, "//div[@aria-label='Message']"))
        )
        text_box.send_keys("Check out @sterlingflexes reels!! They are fireeeee!!")

        # Click on the "Send" button
        send_button = WebDriverWait(driver, 10).until(
            EC.element_to_be_clickable((By.XPATH, "//div[text()='Send']"))
        )
        send_button.click()

        print(f"Message sent to {username} successfully.")

    except TimeoutException:
        try:
        # Find the close button (x) and click it
            close_button = WebDriverWait(driver, 10).until(
            EC.element_to_be_clickable((By.CSS_SELECTOR, "svg[aria-label='Close']"))
            )
            close_button.click()
            print("Closed the popup.")
        except TimeoutException:
            print("Timeout occurred while trying to close the popup.")  
            return
    except Exception as e:
        print(f"Error sending message to {username}:", e)

